      description="AdministraciÃ³n de microempresas y clientes."
    >
      <div className="summary-grid">
        <div className="summary-card">
          <span>Microempresas</span>
          <strong>{dashboardData?.counts?.microempresas ?? 0}</strong>
        </div>
        <div className="summary-card">
          <span>Clientes</span>
